pub const SIN_TABLE_N: usize = 8192;
pub const BARO_TABLE_N: usize = 8192;
/// R*L/(g*M) ≈ 0.190285 — exponent baked into BARO_POW_TABLE.
#[allow(dead_code)]
pub const BARO_EXPONENT: f32 = 0.190_284_82;

/// Fast sin via quarter-wave LUT. Nearest-index, no interpolation.
#[inline]
pub fn sin_lut(mut x: f32) -> f32 {
    // Reduce to [0, 2π)
    x %= TAU;
    if x < 0.0 {
        x += TAU;
    }

    let n = (SIN_TABLE_N - 1) as f32;
    let scale = n / FRAC_PI_2;

    if x < FRAC_PI_2 {
        // Q1
        let idx = (x * scale + 0.5) as usize;
        SIN_TABLE[idx.min(SIN_TABLE_N - 1)]
    } else if x < PI {
        // Q2: sin(π - x)
        let idx = ((PI - x) * scale + 0.5) as usize;
        SIN_TABLE[idx.min(SIN_TABLE_N - 1)]
    } else if x < PI + FRAC_PI_2 {
        // Q3: -sin(x - π)
        let idx = ((x - PI) * scale + 0.5) as usize;
        -SIN_TABLE[idx.min(SIN_TABLE_N - 1)]
    } else {
        // Q4: -sin(2π - x)
        let idx = ((TAU - x) * scale + 0.5) as usize;
        -SIN_TABLE[idx.min(SIN_TABLE_N - 1)]
    }
}

/// Fast cos via sin LUT: cos(x) = sin(x + π/2).
#[inline]
pub fn cos_lut(x: f32) -> f32 {
    sin_lut(x + FRAC_PI_2)
}

/// Fast x^BARO_EXPONENT for x ∈ [0, 1] via direct LUT lookup.
/// Used only for the barometric altitude formula.
#[inline]
pub fn powf_baro(x: f32) -> f32 {
    if x <= 0.0 {
        return 0.0;
    }
    if x >= 1.0 {
        return 1.0;
    }
    let idx = (x * ((BARO_TABLE_N - 1) as f32) + 0.5) as usize;
    BARO_POW_TABLE[idx.min(BARO_TABLE_N - 1)]
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn sin_lut_accuracy() {
        let mut max_err: f32 = 0.0;
        let steps = 100_000;
        for i in 0..=steps {
            let x = (i as f32 / steps as f32) * TAU - PI;
            let expected = libm::sinf(x);
            let got = sin_lut(x);
            let err = (got - expected).abs();
            if err > max_err {
                max_err = err;
            }
        }
        assert!(max_err < 2.0e-4, "sin_lut max error = {max_err}");
    }

    #[test]
    fn cos_lut_accuracy() {
        let mut max_err: f32 = 0.0;
        let steps = 100_000;
        for i in 0..=steps {
            let x = (i as f32 / steps as f32) * TAU - PI;
            let expected = libm::cosf(x);
            let got = cos_lut(x);
            let err = (got - expected).abs();
            if err > max_err {
                max_err = err;
            }
        }
        assert!(max_err < 2.0e-4, "cos_lut max error = {max_err}");
    }

    #[test]
    fn powf_baro_accuracy() {
        // Only test [0.05, 1.0] — the realistic barometric pressure-ratio range.
        // Near x=0 the derivative of x^0.19 diverges and quantisation error dominates,
        // but that region is never reached in practice (would require >50 km altitude).
        let exponent = BARO_EXPONENT;
        let mut max_rel_err: f32 = 0.0;
        let steps = 100_000;
        let x_min: f32 = 0.05;
        for i in 0..=steps {
            let base = x_min + (1.0 - x_min) * (i as f32 / steps as f32);
            let expected = libm::powf(base, exponent);
            let got = powf_baro(base);
            let rel = ((got - expected) / expected).abs();
            if rel > max_rel_err {
                max_rel_err = rel;
            }
        }
        assert!(
            max_rel_err < 5e-4,
            "powf_baro max relative error = {max_rel_err} (want < 0.05%)"
        );
    }
}
